		#region Helper

		private static IEnumerable<LatLng> Ce2ll(IEnumerable<CoordinateEntity> ce)
		{
			foreach (CoordinateEntity c in ce)
			{
				yield return new LatLng(c.Latitude, c.Longitude);
			}
		}

		private static IEnumerable<Location> Ce2loc(IEnumerable<CoordinateEntity> ce)
		{
			foreach (CoordinateEntity c in ce)
			{
				yield return new Location { lat = c.Latitude, lng = c.Longitude };
			}
		}

		private static IEnumerable<LatLng> L2ll(List<Location> locations)
		{
			foreach (Location location in locations)
			{
				yield return new LatLng(location.lat, location.lng);
			}
		}

		#endregion Helper

		#region Timer

		private readonly System.Timers.Timer everySecondTimer = new()
		{
			AutoReset = true,
			Interval = 1000,
		};

		private bool layerShowSatellite = false;

		private async void EverySecondJob(object? sender, ElapsedEventArgs e)
		{
			if (trackUpdatedAt != null)
			{
				var lu = (DateTime.UtcNow - trackUpdatedAt).Value;
				trackUpdatedAtString = $"{lu.Minutes}m {lu.Seconds}s";
			}

			StateHasChanged();

			if (downloadEverySecond != 0 && DateTime.UtcNow.Second % downloadEverySecond == 0)
			{
				await RefreshMap();
				return;
			}

			if (DateTime.UtcNow.Second == secondToDownload)
			{
				await RefreshMap();
			}
		}

		#endregion Timer

