		private async Task AfterMapRender()
		{
			var layerSatelliteOptions = new TileLayerOptions()
			{
				Attribution = "Tiles &copy; Esri &mdash; Source: Esri, i-cubed, USDA, USGS, AEX, GeoEye, Getmapping, Aerogrid, IGN, IGP, UPR-EGP, and the GIS User Community",
			};
			layerSatellite = await LayerFactory.CreateTileLayerAndAddToMap("https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}.png", map, layerSatelliteOptions);

			var layerOSMOptions = new TileLayerOptions()
			{
				Attribution = "&copy; <a href=\"https://www.openstreetmap.org/copyright\">OpenStreetMap</a> contributors",
			};
			layerOSM = await LayerFactory.CreateTileLayerAndAddToMap("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", map, layerOSMOptions);

			NavigationManager.NavigateTo($"{Id}");

			await map.PanTo(new LatLng(47, 13));
			await map.SetZoom(5);

			everySecondTimer.Elapsed += EverySecondJob;
			everySecondTimer.Enabled = true;

			await LayerChangedAsync();

			await RefreshMap();
		}

		private async Task CenterMap(bool force = false)
		{
			if (force)
			{
				firsttime = true;
			}

			if (!firsttime || liveTrack == null || liveTrack.location == null)
			{
				return;
			}

			await map.PanTo(new LatLng(liveTrack.location.lat, liveTrack.location.lng));

			if (liveTrack.route != null && liveTrack.route.route != null && liveTrack.route.route.Count > 0)
			{
				await map.FlyToBounds(
					new LatLngBounds(
					new LatLng(liveTrack.route.SouthBound, liveTrack.route.WestBound),
					new LatLng(liveTrack.route.NorthBound, liveTrack.route.EastBound)));
				firsttime = false;
				return;
			}

			if (liveTrack.locations != null && liveTrack.locations.Count > 0)
			{
				await map.FlyToBounds(
					new LatLngBounds(
					new LatLng(liveTrack.SouthBound, liveTrack.WestBound),
					new LatLng(liveTrack.NorthBound, liveTrack.EastBound)));
				firsttime = false;
				return;
			}

			if (liveTrack.location != null)
			{
				await map.PanTo(new LatLng(liveTrack.location.lat, liveTrack.location.lng));
				firsttime = false;
				return;
			}
		}

		private async Task<bool> DownloadData()
		{
			if (offlineTest)
			{
				var s = offlineTestData[cnt];
				liveTrack = JsonSerializer.Deserialize<LiveTrack>(Encoding.UTF8.GetString(Convert.FromBase64String(s)));
				cnt++;
				if (cnt == offlineTestData.Count)
				{
					cnt = 0;
				}
			}
			else
			{
				if (Id == null || Id == "")
				{
					return false;
				}

				LocalStorage.SetItem<string>(LocalStorageKeyId, Id);

				try
				{
					Console.WriteLine($"Download {Id} @ {DateTime.Now}");
					var response = await HttpClient.GetAsync($"{url}{Id}?t={DateTime.Now}");
					response.EnsureSuccessStatusCode();
					var jsonString = await response.Content.ReadAsStringAsync();
					liveTrack = JsonSerializer.Deserialize<LiveTrack>(jsonString);
				}
				catch (Exception ex)
				{
					Console.WriteLine($"Download error: {ex.Message}");
					return false;
				}
			}
			return true;
		}

		private async Task RefreshMap()
		{
			if (refreshing)
			{
				return;
			}

			refreshing = true;

			await DownloadData();

			if (liveTrack == null)
			{
				refreshing = false;
				return;
			}

			//calc the best time for the next download
			secondToDownload = liveTrack.updatedAt.Value.Second + 10;
			trackUpdatedAt = liveTrack.updatedAt;

			RepaintData();
			await RepaintRoute();
			await CenterMap();
			await RepaintCurrentLocation();
			await RepaintTrack();
			await RepaintPOIs();
			refreshing = false;
		}

		private async Task RepaintCurrentLocation()
		{
			if (livetrackCurrentLocationMarker != null)
			{
				await livetrackCurrentLocationMarker.Remove();
			}

			var arrow = Encoding.UTF8.GetString(Convert.FromBase64String(arrowIcon)).Replace("xxxx", ((double)liveTrack.bearing).ToString(CultureInfo.InvariantCulture));
			var arrowiconurl = "data:image/svg+xml," + arrow;
			IconOptions arrowiconOptions = new()
			{
				IconUrl = arrowiconurl,
				IconSize = new Point(32, 32),
				IconAnchor = new Point(16, 16)
			};

			var arrorMarkerOptions = new MarkerOptions()
			{
				IconRef = await IconFactory.Create(arrowiconOptions),
			};

			livetrackCurrentLocationMarker = await LayerFactory.CreateMarkerAndAddToMap(
				new LatLng(liveTrack.location.lat, liveTrack.location.lng),
				map,
				arrorMarkerOptions);
		}

		private void RepaintData()
		{
			if (liveTrack == null)
			{
				return;
			}

			try
			{
				trackRiderName = liveTrack.riderName;

				var span = TimeSpan.FromMilliseconds((double)liveTrack.activityInfo.Find(r => r.key == "TYPE_ELAPSED_TIME_ID").value.value);
				trackDuration = $"{(int)span.TotalHours:00}:{span.Minutes:00}:{span.Seconds:00}";

				var ascent = liveTrack.activityInfo.Find(r => r.key == "TYPE_ELEVATION_GAIN_ID").value.value;
				ascent *= metric ? 1.0 : 3.28084;
				trackAscent = $"{ascent:0}{(metric ? "m" : "ft")}";

				var distance = liveTrack.activityInfo.Find(r => r.key == "TYPE_DISTANCE_ID").value.value / 1000;
				distance *= metric ? 1.0 : 0.621371;
				trackDistance = $"{distance:N1}{(metric ? "km" : "mi")}";

				var avgSpeed = liveTrack.activityInfo.Find(r => r.key == "TYPE_AVERAGE_SPEED_ID").value.value;
				avgSpeed *= metric ? 1.0 : 0.621371;
				trackAvgSpeed = $"{avgSpeed:N1}{(metric ? "km/h" : "mph")}";

				StateHasChanged();
			}
			catch
			{
			}
		}

		private async Task RepaintPOIs()
		{
			if (liveTrack.route == null || liveTrack.route.pointsOfInterest == null || (liveTrack.route.pointsOfInterest.Count == 0 && livetrackPOIMarkers.Count > 0))
			{
				foreach (var poim in livetrackPOIMarkers)
				{
					await poim.Remove();
				}
				livetrackPOIMarkers.Clear();
			}

			if (liveTrack.route != null && liveTrack.route.pointsOfInterest != null && liveTrack.route.PointsOfInterestHash != formerPointsOfInterestHash)
			{
				formerPointsOfInterestHash = liveTrack.route.PointsOfInterestHash;

				foreach (var poim in livetrackPOIMarkers)
				{
					await poim.Remove();
				}
				livetrackPOIMarkers.Clear();

				foreach (var poi in liveTrack.route.pointsOfInterest)
				{
					var m = await LayerFactory.CreateMarkerAndAddToMap(
						new LatLng(poi.location.lat, poi.location.lng),
						map,
						null);

					await m.BindTooltip(poi.name);

					livetrackPOIMarkers.Add(m);
				}
			}
		}

		private async Task RepaintRoute()
		{
			if (liveTrack.route == null || liveTrack.route.routePolyline == null || liveTrack.route.routePolyline == "")
			{
				if (routePolyline != null)
				{
					await routePolyline.Remove();
					routePolyline = null;
					formerRoutePolylineString = "";
					await CenterMap(true);
				}
			}
			else if (liveTrack.route != null && liveTrack.route.routePolyline != null && liveTrack.route.routePolyline != formerRoutePolylineString)
			{
				formerRoutePolylineString = liveTrack.route.routePolyline;
				var ce = GooglePoints.Decode(liveTrack.route.routePolyline);
				if (routePolyline != null)
				{
					await routePolyline.Remove();
				}

				routePolyline = await LayerFactory.CreatePolylineAndAddToMap(
					Ce2ll(ce),
					map,
					new PolylineOptions() { Color = "blue", Opacity = 0.3, Weight = 10 });

				liveTrack.route.route = Ce2loc(ce).ToList();

				await CenterMap(true);
			}
		}

		private async Task RepaintTrack()
		{
			if (liveTrack.locations != null && liveTrack.locations.Count > livetrackOldLocationsCount)
			{
				livetrackOldLocationsCount = liveTrack.locations.Count;

				if (livetrackTrackPolyline != null)
				{
					await livetrackTrackPolyline.Remove();
				}

				var ccc = liveTrack.locations.Count();


				livetrackTrackPolyline = await LayerFactory.CreatePolylineAndAddToMap(
					L2ll(liveTrack.locations),
					map,
					new PolylineOptions() { Color = "red", Opacity = 0.8 });

				if (firsttime)
				{
					var s = liveTrack.locations.Min(r => r.lat);
					var n = liveTrack.locations.Max(r => r.lat);
					var w = liveTrack.locations.Min(r => r.lng);
					var e = liveTrack.locations.Max(r => r.lng);
					await map.PanTo(new LatLng(liveTrack.location.lat, liveTrack.location.lng));
					await map.FlyToBounds(new LatLngBounds(new LatLng(s, w), new LatLng(n, e)));
					firsttime = false;
				}
			}
		}
